import { FaAward, FaStar, FaHeart, FaDownload } from "react-icons/fa";

export default {
  wallet: [
    {
      count: 200,
      suffixText: "M+",
      body: "Private Sale Round",
    },
    
    {
      count: 120,
      suffixText: "M+",
      body: "Dollars",
    },
  ],
};
